It&amp;rsquo;s been exactly a week since Burger King made every cheese lovers&amp;rsquo; dreams (or nightmares) come true by shoving glowing, orange-ish mac and cheese inside a hollow, fried giant Cheeto. So, how has the fast food company&amp;rsquo;s Mac n&amp;rsquo; Cheetos concoction been received since it officially hit stores on Monday? Let&amp;rsquo;s just say the initial feedback is underwhelming.
Burger King debuted the new menu item last week, describing the portable snack mashup as a &amp;ldquo;dangerously cheesy re-imagination&amp;rdquo; that combines creamy mac n&amp;rsquo; cheese with crispy Cheetos.
But some fast food connoisseurs say the unholy cheese combination &amp;mdash; sold as five pieces for $2.49 &amp;mdash; falls short of the company&amp;rsquo;s description, instead calling them &amp;ldquo;not good,&amp;rdquo; but &amp;ldquo;not totally awful.&amp;rdquo;
That glowing review from For The Win goes on to say that the only redeeming quality of the super sized-stuffed Cheetos is the fact they contain cheese, and &amp;ldquo;cheese is good.&amp;rdquo;
&amp;ldquo;And though there&amp;rsquo;s some mild crispiness to the fried outer crust of the Mac n&amp;rsquo; Cheetos, there&amp;rsquo;s really nothing about them besides the shape that calls to mind a Cheeto,&amp;rdquo; the review states. &amp;ldquo;The primary things we associate with Cheetos, I think, are the crunchiness and the delicious cheese dust they leave on your fingers. Burger King&amp;rsquo;s Mac n&amp;rsquo; Cheetos feature only a hint of crunch and an inexcusable lack of cheese dust.&amp;rdquo;
The Chicago Tribune&amp;nbsp;eloquently described a&amp;nbsp;recent Mac n&amp;rsquo; Cheetos meal as a &amp;ldquo;gritty, fried nugget of Easy Mac, rolled in the remains of the bottom of a bag of Cheetos.&amp;rdquo;
The review also notes that the snack was less cheesy and more salty: &amp;ldquo;Can something be cheesy if there&amp;rsquo;s no semblance of real cheese?&amp;rdquo; the reviewer&amp;nbsp;asks.
A Yahoo review of the meal took issue with the fact that Burger King pushed the product as something every Cheetos-lover would like.
&amp;ldquo;If this product had simply been marketed as &amp;lsquo;fried mac &amp;lsquo;n&amp;rsquo; cheese,&amp;rsquo; I would have to say the Burger King hit it out of the park, but they didn&amp;rsquo;t,&amp;rdquo; the review states. &amp;ldquo;They marketed it as &amp;lsquo;Mac n&amp;rsquo; Cheetos,&amp;rsquo; and it is in Cheetos department that I find them wanting.&amp;rdquo;
While that tester enjoyed the &amp;ldquo;slightly congealed&amp;rdquo; but otherwise &amp;ldquo;Velveeta-y interior,&amp;rdquo; the Cheetos aspect was described as &amp;ldquo;Cheetos-Scented friend stuff.&amp;rdquo;
Food reviewers weren&amp;rsquo;t alone in their unexceptional response to Mac n&amp;rsquo; Cheetos. Actual customers haven&amp;rsquo;t exactly been thrilled with the fried snack.


